import React from 'react'
import s from './Home.module.css'
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className={s.home}>
      <div className={s.titleContainer}>
        <h1 className={s.homeTitle}>Welcome to the Pokemon App</h1>
        <Link className={s.link} to='/pokemons'><button className={s.homeButton}>See all the Pokemons</button></Link>
        <button className={s.homeButton}>See all the Pokemons</button>
      </div>
    </div>
  )
}
